import {Link} from 'react-router-dom'
import './index.css'


function UserDetails(props) {
  return (
       <li className="list-item">
           <p className="name">{name}</p>
           <p className="email">{email}</p>
           <p className="age">{age}</p>
           <hr className='line'/>
       </li>
  )
}

export default UserDetails
